DROP TABLE IF EXISTS `volunteer_info`;
CREATE TABLE `volunteer_info`  (
  `id` bigint NOT NULL AUTO_INCREMENT COMMENT '自增主键，唯一标识每条记录',
  `volunteer_table_id` bigint NULL DEFAULT NULL COMMENT '志愿表ID：用于关联志愿表的唯一标识',
  `type` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '类型：专业类别（例如“理工”），最大长度为50字符',
  `gb_code` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '国标码：学校的国标代码，最大长度为20字符',
  `school` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '学校名称：存储学校名称，最大长度为100字符',
  `ranking` int NULL DEFAULT NULL COMMENT '学校排名：学校的全国排名，整数类型',
  `is_public` tinyint(1) NULL DEFAULT NULL COMMENT '是否公办：公办学校为TRUE，非公办为FALSE',
  `is_211` tinyint(1) NULL DEFAULT NULL COMMENT '是否为211院校：是为TRUE，否为FALSE',
  `is_985` tinyint(1) NULL DEFAULT NULL COMMENT '是否为985院校：是为TRUE，否为FALSE',
  `is_double_first_class` tinyint(1) NULL DEFAULT NULL COMMENT '是否为双一流：是为TRUE，否为FALSE',
  `province` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '省份：学校所在的省份，最大长度为50字符',
  `admission_category` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '1冲2保3稳：填报志愿类别，冲、保、稳等，最大长度为20字符',
  `major` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '专业名称：学生填报的专业名称，最大长度为100字符',
  `major_code` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '专业代码：填报专业的代码，最大长度为20字符',
  `major_group` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '专业组：所属的专业组，最大长度为50字符',
  `education_years` int NULL DEFAULT NULL COMMENT '学制：专业学制（如4年），整数类型',
  `probability` decimal(5, 2) NULL DEFAULT NULL COMMENT '录取概率：该学校专业的录取概率，精确到小数点后两位',
  `min_score_2023` int NULL DEFAULT NULL COMMENT '最低分2023：2023年的最低分数',
  `min_rank_2023` int NULL DEFAULT NULL COMMENT '最低位次2023：2023年的最低位次',
  `min_score_2022` int NULL DEFAULT NULL COMMENT '最低分2022：2022年的最低分数',
  `min_rank_2022` int NULL DEFAULT NULL COMMENT '最低位次2022：2022年的最低位次',
  `min_score_2021` int NULL DEFAULT NULL COMMENT '最低分2021：2021年的最低分数',
  `min_rank_2021` int NULL DEFAULT NULL COMMENT '最低位次2021：2021年的最低位次',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 875 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '高考志愿数据表：存储各高校录取信息及志愿填报数据' ROW_FORMAT = Dynamic;














